// src/App.jsx
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './components/Home/Home';
import CasualPage from './components/Casual/CasualPage';
import ProfessionalPage from './components/Professional/ProfessionalPage';
import './App.css';
import NavbarCasual from './components/NavBar/NavbarCasual';
import NavbarProfessional from './components/NavBar/NavbarProfessional';
import Portfolio from './components/Portfolio/Portfolio';
import ResumeAndCertificates from './components/ResumeAndCertificates/ResumeAndCertificates';
import AboutMe from './components/AboutMe/AboutMe'
import Contact from './components/Contact/Contact';
import Skills from './components/Skills/Skills';
import Services from './components/Services/Services';

const App = () => {
  return (
    <Router>
      <div>
        {/* Conditionally render the Navbar based on the route */}
        <Routes>
          <Route
            path="/casual/*"
            element={
              <AppWithNavbar navbar={<NavbarCasual />} isCasual={true} isProfessional={false}>
                <Portfolio isCasual={true} isProfessional={false} />
              </AppWithNavbar>
            }
          />
          <Route
            path="/professional/*"
            element={
              <AppWithNavbar navbar={<NavbarProfessional />} isCasual={false} isProfessional={true}>
                <Portfolio isCasual={false} isProfessional={true} />
              </AppWithNavbar>
            }
          />
          <Route path="/Portfolio/*" element={<Portfolio isCasual={false} isProfessional={false} />} />
        </Routes>

        {/* Define your other routes */}
        <Routes>
          {/* ... other routes */}
        </Routes>
      </div>
    </Router>
  );
};

const AppWithNavbar = ({ navbar, children, isCasual, isProfessional }) => {
  return (
    <>
      {navbar}
      {React.cloneElement(children, { isCasual, isProfessional })}
    </>
  );
};

export default App;
